import styled from 'styled-components';

const Container = styled.div`
    display: block;
    margin: 32px auto;
    padding: 16px 24px;
    box-sizing: border-box;
    box-shadow: 0px 0px 15px #00000022;
    width: calc(100vw - 64px);
`;

export default Container;
